import React from "react";

const Hotels=(props)=>{
    const display=props.hotels.map((place)=>{
        return(
            <div className="card">
                <div className="card-image">
                    <img src={place.max_photo_url}></img>
                </div>
                <div className="card-content">

                </div>
            </div>
        )
    })
    return(
        <React.Fragment>
            {display}
        </React.Fragment>
    )
}
export default Hotels
